import React from 'react';
import ReactDOM from 'react-dom'; // Importa a sintaxe antiga (sem /client)
// Importa o componente principal da aplicação
import App from './App';
// O arquivo principal de estilos (onde você importa o Tailwind)
import './index.css'; 

// Ponto de entrada da aplicação React usando a sintaxe antiga (v17 ou inferior)
// O Webpack/Babel do Create React App deve injetar o código aqui.
ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
